import React from "react";

class App extends React.Component {
  render() {
    // JSX
    return (
      <div>
        <h2>welcome to my app</h2>
        <form>
          <div className="form-input">
            <input
              type="text"
              name="title"
              placeholder="title"
              value=""
              onChange={2}
            />
          </div>
          <div className="form-input">
            <textarea name="body" cols="30" rows="10" onChange={2}></textarea>
          </div>

          <button>Submit</button>
        </form>
      </div>
    );
  }
}

export default App;
